&quot;Nothing seems to be going Kim's way.
After recently being dumped, her hearthbroken ex-boyfriend has become obsessed with trying to win back her love.
Now the party she was supposed to attend with her best friend just got raided.
After teaming up with four friends who are not ready to call it a night, the group decides to continue the festivities at the sight of the towns most notorious urban legend.
With the ex-boyfriend seeking vengence on Kim and anyone else that gets in his way, the group of friends make the wrong choise when they decide to party at the redsin tower.&quot;
